import logo from './logo.svg';
import './App.css';
import Form from './components/Form/Form';
import Image from './components/Image/Image';

function temp() {
    fetch('http://localhost:3000')
        .then(response => response.json())
        .then(console.log);
}

function App() {
    temp();
  return (
    <div className="">
        <Form />
        <Image />

    </div>
  );
}

export default App;
